  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115003 includes chemical,
  discrete sample, physical and profile data collected from JOHN V. VICKERS in the
  Bering Sea, North Pacific Ocean and South Pacific Ocean from 1992-08-16 to 1992-10-21
  and retrieved during cruise WOCE_P13N. These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
  tetrachloride (CCL4), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE,
  NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen
  isotope) and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Charles D. Keeling and Andrew Dickson
  of Scripps Institution of Oceanography as part of the WOCE_P13N data set.nnThe World
  Ocean Circulation Experiment (WOCE) was a major component of the World Climate Research
  Program with the overall goal of better understanding the ocean's role in climate
  and climatic changes resulting from both natural and anthropogenic causes. The CO2
  survey took advantage of the sampling opportunities provided by the WOCE Hydrographic
  Program (WHP) cruises during this period between 1990 and 1998. The final collection
  covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
